import Link from "next/link";
import Head from "next/head";
import Layout from "../components/layout";

function About() {
  return (
    <div>
      <Layout>

      </Layout>
      <Head>
        <title>About</title>
      </Head>
      <h2>Brittany Yee</h2>
      <p>Software engineer based in NYC</p>
      <Link href="/">
        <a>Back to Home</a>
      </Link>
    </div>
  );
}

export default About;
